// import logo from './logo.svg';
import './App.css';
import Aboutus from './components/layouts/Aboutsus';
import Navbar from './components/layouts/Navbar';
import Contactus from './components/layouts/Contactus';
import Landing from './components/layouts/Landing';
import {  BrowserRouter,Route , Routes} from "react-router-dom";
import Home from './components/layouts/Home';
import Animatedlogo from './components/layouts/Animatedlogo';

function App() {

  return (

  <>
     <Animatedlogo/>
    <BrowserRouter> 
  <Routes>
  <Route exact path="/" element={<Home />}></Route>
  <Route exact path="/navbar" element={<Navbar />}></Route>
    <Route path="/aboutus" element={<Aboutus/> } exact ></Route>
    <Route path="/landing" element={<Landing/>} exact >  </Route>
    <Route path="/contactus" element={<Contactus/>} exact >  </Route>
</Routes>
</BrowserRouter>
  </>
  );
}

export default App;
